import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import './App.css';
import MakeTask from './components/make_task';
import CatalogPage from './components/CatalogPage'; // Import the CatalogPage component

function App() {
  return (
    <div className="App">
      <Router>
        <nav>
          <ul>
            <li><Link to="/">Catalog</Link></li>
            <li><Link to="/make-task">Make Task</Link></li>
          </ul>
        </nav>
        <Switch>
          <Route path="/" exact component={CatalogPage} />
          <Route path="/make-task" component={MakeTask} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
